query:
/*+ NoMergeJoin(mc t) */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id = 27 AND mc.company_type_id > 1 AND t.kind_id = 1 AND t.production_year = 1994
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND mi_idx.info_type_id = 100;
